    DataService.prototype.compare = function (savedData, draftData, lastReadData) {
        var savedDataCheck = this.getIndexedData(savedData);
        var draftDataCheck = this.getIndexedData(draftData);
        var lastReadDataCheck = this.getIndexedData(lastReadData);
        var changeFlag = true;
        var updatedFlag = true;
        if (this.checkEquality(draftDataCheck, lastReadDataCheck)) {
            changeFlag = false;
        }
        if (this.checkEquality(savedDataCheck, lastReadDataCheck)) {
            updatedFlag = false;
        }
        if (this.checkEquality(savedDataCheck, draftDataCheck)) {
            updatedFlag = false;
            changeFlag = false;
        }
        if (!changeFlag && !updatedFlag) {
            return { status: "noop" };
        }
        else if (changeFlag && !updatedFlag) {
            return {
                status: "change",
                data: {
                    draft: draftData,
                    conflicts: this.findConflict(savedDataCheck, draftDataCheck, lastReadDataCheck)
                }
            };
        }
        else if (!changeFlag && updatedFlag) {
            return {
                status: "commit",
                data: {
                    committed: savedData,
                    conflicts: this.findConflict(savedDataCheck, draftDataCheck, lastReadDataCheck)
                }
            };
        }
        else {
            return {
                status: "conflict",
                data: {
                    draft: draftData,
                    committed: savedData,
                    conflicts: this.findConflict(savedDataCheck, draftDataCheck, lastReadDataCheck)
                }
            };
        }
    };
